const initialState = {
  data: {},
  count: 5,
  delete: false,
};
function reducer(state = initialState, action) {
  let count_data = state.count + 1;
  if (action.type === "submit") {
    return {
      ...state,
      count: count_data,
      data: action.value,
    };
  }
  return state;
}
export default reducer;
